import React from "./node_modules/react";
import "./ImgCard.css";

const ImgCard = props => (
  <div className="ImgCard" onClick={() => props.clickCount(props.id)}>
    <div className="img-container">
      <img alt={props.name} src={props.imageUrl} />
    </div>
  </div>
);

export default ImgCard;
